(***********************************************
VQCDInitialConditions.m

Initial conditions for the VQCD model. This would logically reside in the main file, but
due to the extreme length of the expressions they have been moved to this separate file.

Written by Timo Alho

Package created on 2013/9/23
************************************************)
BeginPackage["VQCDThermo`VQCDInitialConditions`"]

FiniteTInitialConditions::usage = "Returns a list of initial conditions for a non-extremal horizon. See main file for usage"
ExtremalInitialConditions::usage = "Returns a list of initial conditions for an extremal horizon. See main file for usage"

Begin["`Private`"]


FiniteTInitialConditions[\[Lambda]h_, nt_, fph_, \[Tau]h_, Vg_, Vf_, \[Kappa]_, \[Omega]_] := Module[{qh, \[Tau]ph, \[Tau]pph, fpph, qph, \[Lambda]ph, qpph, \[Lambda]pph, fppph},
qh = -(Sqrt[3]/Sqrt[Vg[\[Lambda]h]/fph - 
    (Vf[\[Lambda]h, \[Tau]h]*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)])/fph]);

\[Tau]ph = (qh^2*Vf[\[Lambda]h, \[Tau]h]*\[Kappa][\[Lambda]h]*Derivative[0, 1][Vf][\[Lambda]h, \[Tau]h])/
 (fph*nt^2 + fph*Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2);

fpph = (fph*
  (
   (48*Sqrt[(Vg[\[Lambda]h] - Vf[\[Lambda]h, \[Tau]h]*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*
             \[Kappa][\[Lambda]h]^2)])/fph]*(-7*nt^2 - 4*Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2 + 
      4*Vf[\[Lambda]h, \[Tau]h]*Vg[\[Lambda]h]*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*
       \[Kappa][\[Lambda]h]^2))/(nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2 - 
     Vf[\[Lambda]h, \[Tau]h]*Vg[\[Lambda]h]*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*
      \[Kappa][\[Lambda]h]^2) + 
   (4*Sqrt[(Vg[\[Lambda]h] - Vf[\[Lambda]h, \[Tau]h]*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*
             \[Kappa][\[Lambda]h]^2)])/fph]*(8*Vf[\[Lambda]h, \[Tau]h]*Vg[\[Lambda]h]^2*
       Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^2*
       (nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2) - 
      2*Vg[\[Lambda]h]*(11*nt^4 + 19*nt^2*Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2 + 
        8*Vf[\[Lambda]h, \[Tau]h]^4*\[Kappa][\[Lambda]h]^4) + Vf[\[Lambda]h, \[Tau]h]*
       (14*nt^4*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)] + 
        22*nt^2*Vf[\[Lambda]h, \[Tau]h]^2*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*
             \[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^2 + 8*Vf[\[Lambda]h, \[Tau]h]^4*
         Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^4 + 
        3*Vf[\[Lambda]h, \[Tau]h]*\[Kappa][\[Lambda]h]^3*Derivative[0, 1][Vf][\[Lambda]h, \[Tau]h]^2)))/
    (Vf[\[Lambda]h, \[Tau]h]*(Vg[\[Lambda]h] - Vf[\[Lambda]h, \[Tau]h]*
        Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)])^2*
     Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^2*
     (nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)) + 
   (4*Sqrt[(Vg[\[Lambda]h] - Vf[\[Lambda]h, \[Tau]h]*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*
             \[Kappa][\[Lambda]h]^2)])/fph]*(8*Vf[\[Lambda]h, \[Tau]h]*Vg[\[Lambda]h]^2*
       Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^2*
       (nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2) - 
      2*Vg[\[Lambda]h]*(11*nt^4 + 19*nt^2*Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2 + 
        8*Vf[\[Lambda]h, \[Tau]h]^4*\[Kappa][\[Lambda]h]^4) + Vf[\[Lambda]h, \[Tau]h]*
       (14*nt^4*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)] + 
        22*nt^2*Vf[\[Lambda]h, \[Tau]h]^2*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*
             \[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^2 + 8*Vf[\[Lambda]h, \[Tau]h]^4*
         Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^4 + 
        9*Vf[\[Lambda]h, \[Tau]h]*\[Kappa][\[Lambda]h]^3*Derivative[0, 1][Vf][\[Lambda]h, \[Tau]h]^2)))/
    (Vf[\[Lambda]h, \[Tau]h]*(Vg[\[Lambda]h] - Vf[\[Lambda]h, \[Tau]h]*
        Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)])^2*
     Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^2*
     (nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)) + 
   (9*\[Lambda]h^2*Sqrt[(Vg[\[Lambda]h] - Vf[\[Lambda]h, \[Tau]h]*
         Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)])/fph]*
     (nt^2*Derivative[1][\[Kappa]][\[Lambda]h] + Vf[\[Lambda]h, \[Tau]h]*\[Kappa][\[Lambda]h]^3*
        (Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*Derivative[1][Vg][\[Lambda]h] - 
         Derivative[1, 0][Vf][\[Lambda]h, \[Tau]h]))^2)/
    ((Vg[\[Lambda]h] - Vf[\[Lambda]h, \[Tau]h]*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)])^2*
     \[Kappa][\[Lambda]h]^4*(nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)) - 
   (9*\[Lambda]h^2*(nt^2*Derivative[1][\[Kappa]][\[Lambda]h] + Vf[\[Lambda]h, \[Tau]h]*\[Kappa][\[Lambda]h]^3*
       (Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*Derivative[1][Vg][\[Lambda]h] - 
        Derivative[1, 0][Vf][\[Lambda]h, \[Tau]h]))*
     Sqrt[(nt^4*\[Kappa][\[Lambda]h]^4*Derivative[1][Vg][\[Lambda]h]^2 + 
        nt^6*Derivative[1][\[Kappa]][\[Lambda]h]^2 + nt^4*Vf[\[Lambda]h, \[Tau]h]*
         (Vf[\[Lambda]h, \[Tau]h] - Vg[\[Lambda]h]*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^
                2)])*\[Kappa][\[Lambda]h]^2*Derivative[1][\[Kappa]][\[Lambda]h]^2 - 
        2*nt^4*\[Kappa][\[Lambda]h]^3*Derivative[1][\[Kappa]][\[Lambda]h]*
         (Vg[\[Lambda]h]*Derivative[1][Vg][\[Lambda]h] + Vf[\[Lambda]h, \[Tau]h]*
           (-(Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*Derivative[1][Vg][
               \[Lambda]h]) + Derivative[1, 0][Vf][\[Lambda]h, \[Tau]h])) + 
        2*nt^2*Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^5*Derivative[1][\[Kappa]][\[Lambda]h]*
         (Vf[\[Lambda]h, \[Tau]h]*(Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*
             Derivative[1][Vg][\[Lambda]h] - Derivative[1, 0][Vf][\[Lambda]h, \[Tau]h]) + 
          Vg[\[Lambda]h]*(-Derivative[1][Vg][\[Lambda]h] + Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*
                 \[Kappa][\[Lambda]h]^2)]*Derivative[1, 0][Vf][\[Lambda]h, \[Tau]h])) + 
        nt^2*Vf[\[Lambda]h, \[Tau]h]*\[Kappa][\[Lambda]h]^6*(Vg[\[Lambda]h]*Derivative[1][Vg][\[Lambda]h]*
           (-(Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*Derivative[1][Vg][
               \[Lambda]h]) + 2*Derivative[1, 0][Vf][\[Lambda]h, \[Tau]h]) + 
          Vf[\[Lambda]h, \[Tau]h]*(2*Derivative[1][Vg][\[Lambda]h]^2 - 
            2*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*Derivative[1][Vg][
              \[Lambda]h]*Derivative[1, 0][Vf][\[Lambda]h, \[Tau]h] + Derivative[1, 0][Vf][\[Lambda]h, 
              \[Tau]h]^2)) + Vf[\[Lambda]h, \[Tau]h]^3*\[Kappa][\[Lambda]h]^8*
         (Vf[\[Lambda]h, \[Tau]h]*(Derivative[1][Vg][\[Lambda]h]^2 - 
            2*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*Derivative[1][Vg][
              \[Lambda]h]*Derivative[1, 0][Vf][\[Lambda]h, \[Tau]h] + Derivative[1, 0][Vf][\[Lambda]h, 
              \[Tau]h]^2) - Vg[\[Lambda]h]*(Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*
             Derivative[1][Vg][\[Lambda]h]^2 - 2*Derivative[1][Vg][\[Lambda]h]*
             Derivative[1, 0][Vf][\[Lambda]h, \[Tau]h] + Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*
                 \[Kappa][\[Lambda]h]^2)]*Derivative[1, 0][Vf][\[Lambda]h, \[Tau]h]^2)))/
       (fph*(Vg[\[Lambda]h] - Vf[\[Lambda]h, \[Tau]h]*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*
              \[Kappa][\[Lambda]h]^2)])*\[Kappa][\[Lambda]h]^4*(nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)*
        (nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2 - Vf[\[Lambda]h, \[Tau]h]*Vg[\[Lambda]h]*
          Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^2))])/
    (\[Kappa][\[Lambda]h]*(nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2 - 
      Vf[\[Lambda]h, \[Tau]h]*Vg[\[Lambda]h]*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*
       \[Kappa][\[Lambda]h]^2))))/
 (32*Sqrt[(Vg[\[Lambda]h] - Vf[\[Lambda]h, \[Tau]h]*
      Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)])/fph]);

qph = -(Sqrt[3]*((-16*(7*nt^2 + 4*Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2 - 
       4*Vf[\[Lambda]h, \[Tau]h]*Vg[\[Lambda]h]*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*
        \[Kappa][\[Lambda]h]^2))/(nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2 - 
      Vf[\[Lambda]h, \[Tau]h]*Vg[\[Lambda]h]*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*
       \[Kappa][\[Lambda]h]^2) + 
    (4*(8*Vf[\[Lambda]h, \[Tau]h]*Vg[\[Lambda]h]^2*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*
            \[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^2*(nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2) - 
       2*Vg[\[Lambda]h]*(11*nt^4 + 19*nt^2*Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2 + 
         8*Vf[\[Lambda]h, \[Tau]h]^4*\[Kappa][\[Lambda]h]^4) + Vf[\[Lambda]h, \[Tau]h]*
        (14*nt^4*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)] + 
         22*nt^2*Vf[\[Lambda]h, \[Tau]h]^2*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*
              \[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^2 + 8*Vf[\[Lambda]h, \[Tau]h]^4*
          Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^4 + 
         3*Vf[\[Lambda]h, \[Tau]h]*\[Kappa][\[Lambda]h]^3*Derivative[0, 1][Vf][\[Lambda]h, \[Tau]h]^2)))/
     (Vf[\[Lambda]h, \[Tau]h]*(Vg[\[Lambda]h] - Vf[\[Lambda]h, \[Tau]h]*
         Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)])^2*
      Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^2*
      (nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)) + 
    (4*(8*Vf[\[Lambda]h, \[Tau]h]*Vg[\[Lambda]h]^2*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*
            \[Kappa][\[Lambda]h]^2)]*\[Kappa][\[Lambda]h]^2*(nt^2 + Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2) - 
       2*Vg[\[Lambda]h]*(11*nt^4 + 19*nt^2*Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2 + 
         8*Vf[\[Lambda]h, \[Tau]h]^4*\[Kappa][\[Lambda]h]^4) + Vf[\[Lambda]h, \[Tau]h]*
        (14*nt^4*Sqrt[1 + nt^2/(Vf[\[Lambda]h, \[Tau]h]^2*\[Kappa][\[Lambda]h]^2)] + 
